                    y = ApproxUtil<Pow2.N16>.Pade(x - 4, pade_plus_4_5);
                }
                else if (x <= 6) {
                    y = ApproxUtil<Pow2.N16>.Pade(x - 5, pade_plus_5_6);
                }
                else if (x <= 8) {
                    y = ApproxUtil<Pow2.N16>.Pade(x - 6, pade_plus_6_8);
