                }
                else if (x <= 16) {
                    y = ApproxUtil<Pow2.N16>.Pade(x - 12, pade_plus_12_16);
                }
                else {
                    MultiPrecision<Pow2.N16> v = MultiPrecision<Pow2.N16>.Sqrt(x);
                    MultiPrecision<Pow2.N16> u = 1 / MultiPrecision<Pow2.N16>.Cube(v);

                    y = ApproxUtil<Pow2.N16>.Pade(u, pade_plus_limit) * u;
                }

                return complementary ? y : 1 - y;
            }
            else {
                x = -x;

                if (x <= 0.5) {
                    if (x <= 0.25) {
                        y = ApproxUtil<Pow2.N16>.Pade(0.25 - x, pade_minus_0p25_0);
