                    else if (x <= 48) {
                        y = ApproxUtil<Pow2.N16>.Pade(x - 40, pade_minus_40_48);
                    }
                    else if (x <= 64) {
                        y = ApproxUtil<Pow2.N16>.Pade(x - 48, pade_minus_48_64);
